import React from "react";
import Data from "./Data";
import Header from "./Header";
import "../Css/Store.css";
import image1 from '../Images/home4.png';
import image2 from '../Images/home5.png';
import image3 from '../Images/home6.png';
import image4 from '../Images/home6.png';
import image5 from '../Images/home7.png';
import image6 from '../Images/home8.png';

const Store = () => {
  // console.log(Data);
  return (
    <>
      <Header />
      <div className="subNav">
        <div className="d-flex justify-content-around m-auto storeNav">
          <div className="list">
            <a href="">Timeless Romance</a>
          </div>
          <div className="list">
            <a href="">Celestial Couture</a>
          </div>
          <div className="list">
            <a href="">Celestial Couture</a>
          </div>
        </div>
      </div>
      <div className=" mt-5 row gallery">
        {Data.map((data) => (
          <div className="imgContainer col-4">
            <img src={data.image} alt="" className="" />
          </div>
          
        ))}
      </div>

      <div className="container text-center mt-5">
        <h3 className="pt-5 text-uppercase couture-heading">Accesories</h3>
        <h3 className="pt-1 home-heading">Complete the look</h3>
        <p className="home-text pb-5">
        Our walk in store is available & open to every bride, walk in and find just the right accessories for your wonderful day.
        </p>
      </div>

      <div className=" mt-5 gallery2">
        
          <div className="imgContainer2 d-flex">
            <img src={image1} alt="" className="img" />
            <img src={image2} alt="" className="img" />
            <img src={image2} alt="" className="img" />
            <img src={image3} alt="" className="img" />

          <div className="modal fade" id="image" tabi>

          </div>

          </div>
          <div className="imgContainer2 d-flex">
            <img src={image4} alt="" className="img" />
            <img src={image5} alt="" className="img" />
            <img src={image5} alt="" className="img" />
            <img src={image6} alt="" className="img" />
          </div>

          
       
      </div>
    </>
  );
};
export default Store;
